import style from './Dialog.module.css';
import {NavLink} from "react-router-dom";

const DialogItem = (props) =>{
    return <div className={`${style.dialog} ${style.active}`}>
        <NavLink to = {"/dialogs/"+props.profile_id}>{props.name}</NavLink>
    </div>
}

const MessageItem = (props) =>{
    return
    <div className={`${style.message} ${style.active}`}>hi!</div>
}

const  Dialogs = () => {
    return (
        <div className={style.dialogs}>
            <div className = {style.dialogsItems}>
                <DialogItem name = 'Alexey' profile_id = '1'/>
                <DialogItem name = 'Sasha' profile_id = '2'/>
                <DialogItem name = 'Anton' profile_id = '3'/>
                <DialogItem name = 'Valera' profile_id = '4'/>
            </div>
            <div className={style.messages}>
                <div className={`${style.message} ${style.active}`}>hi!</div>
                <div className={style.message}>Hello!</div>
                <div className={style.message}>Darov!</div>
            </div>
        </div>
    );
}

export default  Dialogs;
